var suggestions=document.getElementById('suggestions');var userinput=document.getElementById('userinput');document.addEventListener('keydown',inputFocus);function inputFocus(e){if(e.keyCode===191){e.preventDefault();userinput.focus();}
if(e.keyCode===27){userinput.blur();suggestions.classList.add('d-none');}}
document.addEventListener('click',function(event){var isClickInsideElement=suggestions.contains(event.target);if(!isClickInsideElement){suggestions.classList.add('d-none');}});document.addEventListener('keydown',suggestionFocus);function suggestionFocus(e){const focusableSuggestions=suggestions.querySelectorAll('a');const focusable=[...focusableSuggestions];const index=focusable.indexOf(document.activeElement);let nextIndex=0;if(e.keyCode===38){e.preventDefault();nextIndex=index>0?index-1:0;focusableSuggestions[nextIndex].focus();}
else if(e.keyCode===40){e.preventDefault();nextIndex=index+1<focusable.length?index+1:index;focusableSuggestions[nextIndex].focus();}}
(function(){var index=new FlexSearch({preset:'score',cache:true,doc:{id:'id',field:['title','description','content',],store:['href','title','description',],},});var docs=[{id:0,href:"/docs/self-hosting/app-engine/",title:"Google App Engine",description:"Deploying Dekart to Google App Engine",content:"\u003ch2 id=\"prerequisites\"\u003ePrerequisites\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003eGoogle Cloud Project\u003c/li\u003e\n\u003cli\u003eBigQuery API Enabled\u003c/li\u003e\n\u003cli\u003eMapbox Token\u003c/li\u003e\n\u003c/ul\u003e\n\u003cp\u003e\u003cstrong\u003eIn this guide you will create:\u003c/strong\u003e\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eCloud SQL DB\u003c/li\u003e\n\u003cli\u003eCloud Storage Bucket\u003c/li\u003e\n\u003cli\u003eApp Engine App (Flexible environment)\u003c/li\u003e\n\u003cli\u003eConfigure Access to specific Google Accounts with Google IAP\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"steps\"\u003eSteps\u003c/h2\u003e\n\u003col\u003e\n\u003cli\u003eCreate db instance\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"highlight\"\u003e\u003cpre class=\"chroma\"\u003e\u003ccode class=\"language-bash\" data-lang=\"bash\"\u003egcloud sql instances create \u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eDB_INSTANCE_NAME\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e    --database-version\u003cspan class=\"o\"\u003e=\u003c/span\u003ePOSTGRES_12 \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e    --tier\u003cspan class=\"o\"\u003e=\u003c/span\u003edb-f1-micro\u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e    --region\u003cspan class=\"o\"\u003e=\u003c/span\u003eeurope-west1\n\u003c/code\u003e\u003c/pre\u003e\u003c/div\u003e\u003col start=\"2\"\u003e\n\u003cli\u003eCreate database\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003egcloud sql databases create dekart --instance=${DB_INSTANCE_NAME}\n\u003c/code\u003e\u003c/pre\u003e\u003col start=\"3\"\u003e\n\u003cli\u003eSet password; can be not secret, because there is one more layer of encryption and authorization in Cloud SQL\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003egcloud sql users set-password postgres --instance=${DB_INSTANCE_NAME} --password=dekart\n\u003c/code\u003e\u003c/pre\u003e\u003col start=\"4\"\u003e\n\u003cli\u003eCreate storage\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003egsutil mb -b on -l europe-west1 gs://${BUCKET}/\n\u003c/code\u003e\u003c/pre\u003e\u003col start=\"5\"\u003e\n\u003cli\u003eCreate App Engine App\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003egcloud app create --region=europe-west\n\u003c/code\u003e\u003c/pre\u003e\u003col start=\"6\"\u003e\n\u003cli\u003e\n\u003cp\u003eCreate \u003ca href=\"https://github.com/dekart-xyz/dekart/tree/main/install/app-engine/Dockerfile\"\u003eDockerfile\u003c/a\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eCreate \u003ca href=\"https://github.com/dekart-xyz/dekart/tree/main/install/app-engine/app.example.yaml\"\u003eapp.yaml\u003c/a\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eDeploy app\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003egcloud app deploy app.yaml\n\u003c/code\u003e\u003c/pre\u003e\u003col start=\"9\"\u003e\n\u003cli\u003e\u003ca href=\"https://cloud.google.com/iap/docs/app-engine-quickstart\"\u003eConfigure Google IAP\u003c/a\u003e (works only with web console)\u003c/li\u003e\n\u003c/ol\u003e\n\u003ch2 id=\"example\"\u003eExample\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003eAll gcloud commands in \u003ca href=\"https://github.com/dekart-xyz/dekart/tree/main/install/app-engine/Makefile\"\u003eMakefile\u003c/a\u003e\u003c/li\u003e\n\u003cli\u003eFull \u003ca href=\"https://github.com/dekart-xyz/dekart/tree/main/install/app-engine\"\u003eexample\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n"},{id:1,href:"/docs/self-hosting/docker/",title:"Docker",description:"Running Dekart as in Docker",content:"\u003ch2 id=\"prerequisites\"\u003ePrerequisites\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003eGoogle Cloud Project\u003c/li\u003e\n\u003cli\u003eBigQuery API Enabled\u003c/li\u003e\n\u003cli\u003eCloud SQL DB (Postgres)\u003c/li\u003e\n\u003cli\u003eCloud Storage Bucket\u003c/li\u003e\n\u003cli\u003eService account credentials with access to all above\u003c/li\u003e\n\u003cli\u003eMapbox Token\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"running-docker\"\u003eRunning docker\u003c/h2\u003e\n\u003cdiv class=\"highlight\"\u003e\u003cpre class=\"chroma\"\u003e\u003ccode class=\"language-bash\" data-lang=\"bash\"\u003edocker run \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  -v \u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eGOOGLE_APPLICATION_CREDENTIALS\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e:\u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eGOOGLE_APPLICATION_CREDENTIALS\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  -e \u003cspan class=\"nv\"\u003eGOOGLE_APPLICATION_CREDENTIALS\u003c/span\u003e\u003cspan class=\"o\"\u003e=\u003c/span\u003e\u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eGOOGLE_APPLICATION_CREDENTIALS\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  -e \u003cspan class=\"nv\"\u003eDEKART_POSTGRES_DB\u003c/span\u003e\u003cspan class=\"o\"\u003e=\u003c/span\u003e\u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eDEKART_POSTGRES_DB\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  -e \u003cspan class=\"nv\"\u003eDEKART_POSTGRES_USER\u003c/span\u003e\u003cspan class=\"o\"\u003e=\u003c/span\u003e\u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eDEKART_POSTGRES_USER\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  -e \u003cspan class=\"nv\"\u003eDEKART_POSTGRES_PASSWORD\u003c/span\u003e\u003cspan class=\"o\"\u003e=\u003c/span\u003e\u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eDEKART_POSTGRES_PASSWORD\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  -e \u003cspan class=\"nv\"\u003eDEKART_POSTGRES_PORT\u003c/span\u003e\u003cspan class=\"o\"\u003e=\u003c/span\u003e\u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eDEKART_POSTGRES_PORT\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  -e \u003cspan class=\"nv\"\u003eDEKART_POSTGRES_HOST\u003c/span\u003e\u003cspan class=\"o\"\u003e=\u003c/span\u003e\u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eDEKART_POSTGRES_HOST\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  -e \u003cspan class=\"nv\"\u003eDEKART_CLOUD_STORAGE_BUCKET\u003c/span\u003e\u003cspan class=\"o\"\u003e=\u003c/span\u003e\u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eDEKART_CLOUD_STORAGE_BUCKET\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  -e \u003cspan class=\"nv\"\u003eDEKART_BIGQUERY_PROJECT_ID\u003c/span\u003e\u003cspan class=\"o\"\u003e=\u003c/span\u003e\u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eDEKART_BIGQUERY_PROJECT_ID\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  -e \u003cspan class=\"nv\"\u003eDEKART_MAPBOX_TOKEN\u003c/span\u003e\u003cspan class=\"o\"\u003e=\u003c/span\u003e\u003cspan class=\"si\"\u003e${\u003c/span\u003e\u003cspan class=\"nv\"\u003eDEKART_MAPBOX_TOKEN\u003c/span\u003e\u003cspan class=\"si\"\u003e}\u003c/span\u003e \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  -p 8080:8080 \u003cspan class=\"se\"\u003e\\\n\u003c/span\u003e\u003cspan class=\"se\"\u003e\u003c/span\u003e  dekartxyz/dekart:0.2\n\u003c/code\u003e\u003c/pre\u003e\u003c/div\u003e\u003cp\u003eSee details on \u003ca href=\"/docs/configuration/environment-variables\"\u003eenvironment variables\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"example\"\u003eExample\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003eRun with \u003ca href=\"https://github.com/dekart-xyz/dekart/blob/main/install/docker/Makefile\"\u003eMakefile\u003c/a\u003e\u003c/li\u003e\n\u003c/ul\u003e\n"},{id:2,href:"/docs/self-hosting/docker-compose/",title:"Docker Compose",description:"Run Dekart locally with docker-compose",content:"\u003ch2 id=\"prerequisites\"\u003ePrerequisites\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003eGoogle Cloud Project\u003c/li\u003e\n\u003cli\u003eBigQuery API Enabled\u003c/li\u003e\n\u003cli\u003eCloud Storage Bucket\u003c/li\u003e\n\u003cli\u003eService account credentials with access to all above\u003c/li\u003e\n\u003cli\u003eMapbox Token\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"steps\"\u003eSteps\u003c/h2\u003e\n\u003col\u003e\n\u003cli\u003eCopy \u003ca href=\"https://github.com/dekart-xyz/dekart/blob/main/install/docker-compose/docker-compose.yaml\"\u003edocker-compose.yaml\u003c/a\u003e file\u003c/li\u003e\n\u003cli\u003eCreate \u003ccode\u003e.env\u003c/code\u003e file\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003ePOSTGRES_PASSWORD=\nPROJECT_ID=\nCLOUD_STORAGE_BUCKET=\nMAPBOX_TOKEN=\nGOOGLE_APPLICATION_CREDENTIALS=\n\u003c/code\u003e\u003c/pre\u003e\u003col start=\"3\"\u003e\n\u003cli\u003eRun\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003edocker-compose  --env-file .env up\n\u003c/code\u003e\u003c/pre\u003e"},{id:3,href:"/docs/self-hosting/from-source/",title:"Build from Source",description:"Build Dekart from Source",content:"\u003ch2 id=\"prerequisites\"\u003ePrerequisites\u003c/h2\u003e\n\u003cul\u003e\n\u003cli\u003eGoogle Cloud Project\u003c/li\u003e\n\u003cli\u003eBigQuery API Enabled\u003c/li\u003e\n\u003cli\u003eCloud Storage Bucket\u003c/li\u003e\n\u003cli\u003eService account credentials with access to all above\u003c/li\u003e\n\u003cli\u003eMapbox Token\u003c/li\u003e\n\u003c/ul\u003e\n\u003ch2 id=\"steps\"\u003eSteps\u003c/h2\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eCheckout \u003ca href=\"https://github.com/dekart-xyz/dekart\"\u003eDekart from GitHub\u003c/a\u003e; navigate to project directory;\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eInstall frontend dependencies\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003enpm install\n\u003c/code\u003e\u003c/pre\u003e\u003col\u003e\n\u003cli\u003eCreate and edit \u003ccode\u003e.env\u003c/code\u003e; see \u003ca href=\"/docs/configuration/environment-variables/\"\u003eenvironment variables\u003c/a\u003e for details\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003ecp .env.example .env\n\u003c/code\u003e\u003c/pre\u003e\u003col start=\"4\"\u003e\n\u003cli\u003eRun Postgres DB locally\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003edocker-compose  --env-file .env up\n\u003c/code\u003e\u003c/pre\u003e\u003col start=\"5\"\u003e\n\u003cli\u003eRun Server; you will need to install \u003ca href=\"https://github.com/joho/godotenv\"\u003egodotenv\u003c/a\u003e or handle environment variable otherwise\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003egodotenv -f .env go run ./src/server/main.go\n\u003c/code\u003e\u003c/pre\u003e\u003col start=\"6\"\u003e\n\u003cli\u003eRun frontend\u003c/li\u003e\n\u003c/ol\u003e\n\u003cpre\u003e\u003ccode\u003enpm start\n\u003c/code\u003e\u003c/pre\u003e"},{id:4,href:"/docs/configuration/environment-variables/",title:"Environment Variables",description:"Environment Variables",content:"\u003ch2 id=\"production-configuration\"\u003eProduction configuration\u003c/h2\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003eName\u003c/th\u003e\n\u003cth\u003eDescription\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_BIGQUERY_PROJECT_ID\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003eUnique identifier for your Google Cloud project with BigQuery API Enabled. \u003cbr\u003e \u003cem\u003eExample\u003c/em\u003e: \u003ccode\u003emy-project\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_CLOUD_STORAGE_BUCKET\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003e\u003ca href=\"https://cloud.google.com/storage\"\u003eGoogle Cloud Storage\u003c/a\u003e bucket name where Dekart Query results will be stored. \u003cbr\u003e \u003cem\u003eExample\u003c/em\u003e: \u003ccode\u003edekart-bucket\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_MAPBOX_TOKEN\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003e\u003ca href=\"https://docs.mapbox.com/help/how-mapbox-works/access-tokens/\"\u003eMapbox Token\u003c/a\u003e to show a map\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_POSTGRES_DB\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003eDatabase name. Dekart needs Postgres Database to store query meta information. \u003cbr\u003e \u003cem\u003eExample\u003c/em\u003e: \u003ccode\u003edekart\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_POSTGRES_HOST\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003e\u003cem\u003eExample\u003c/em\u003e: \u003ccode\u003elocalhost\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_POSTGRES_PORT\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003e\u003cem\u003eExample\u003c/em\u003e: \u003ccode\u003e5432\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_POSTGRES_USER\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003e\u003cem\u003eExample\u003c/em\u003e: \u003ccode\u003epostgres\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_POSTGRES_PASSWORD\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003e\u003cem\u003eExample\u003c/em\u003e: \u003ccode\u003e******\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_PORT\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003e\u003cem\u003eExample\u003c/em\u003e: \u003ccode\u003e8080\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eGOOGLE_APPLICATION_CREDENTIALS\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003eCredentials for \u003ca href=\"https://cloud.google.com/docs/authentication/getting-started\"\u003eGoogle Cloud API\u003c/a\u003e \u003cbr\u003e \u003cem\u003eExample\u003c/em\u003e: \u003ccode\u003e/.../service-account-123456.json\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch2 id=\"user-management-with-google-iap\"\u003eUser management with Google IAP\u003c/h2\u003e\n\u003cp\u003eDekart can read \u003ca target=\"_blank\" href=\"https://cloud.google.com/iap/docs/signed-headers-howto\"\u003eclaims provided by Google IAP\u003c/a\u003e and implement following policies:\u003c/p\u003e\n\u003cul\u003e\n\u003cli\u003eUser can list and edit only their own reports\u003c/li\u003e\n\u003cli\u003eUsers have read-only access to other users reports\u003c/li\u003e\n\u003c/ul\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003eName\u003c/th\u003e\n\u003cth\u003eDescription\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_REQUIRE_IAP\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003eEnables validation Google IAP JWT. Required users to be authenticated. ENables user management policies. \u003cbr\u003e \u003cem\u003eExample value\u003c/em\u003e: \u003ccode\u003e1\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_IAP_JWT_AUD\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003eSigned Header JWT Audience (\u003ccode\u003eaud\u003c/code\u003e). You can get the values for the aud string mentioned above by accessing the Cloud Console, or you can use the gcloud command-line tool. \u003ca href=\"https://cloud.google.com/iap/docs/signed-headers-howto#verifying_the_jwt_payload\"\u003eSee details\u003c/a\u003e.  \u003cbr\u003e \u003cem\u003eExample value\u003c/em\u003e: \u003ccode\u003e/projects/PROJECT_NUMBER/apps/PROJECT_ID\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch2 id=\"development-specific\"\u003eDevelopment specific\u003c/h2\u003e\n\u003cp\u003eDo not change for production\u003c/p\u003e\n\u003ctable\u003e\n\u003cthead\u003e\n\u003ctr\u003e\n\u003cth\u003eName\u003c/th\u003e\n\u003cth\u003eDescription\u003c/th\u003e\n\u003c/tr\u003e\n\u003c/thead\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_LOG_DEBUG\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003eSet Dekart log level to debug \u003cbr\u003e \u003cem\u003eExample value\u003c/em\u003e: \u003ccode\u003e1\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_LOG_PRETTY\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003ePrint pretty colorful logs in console. By default Dekart formats logs as JSON \u003cbr\u003e \u003cem\u003eExample value\u003c/em\u003e: \u003ccode\u003e1\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003e\u003ccode\u003eDEKART_STATIC_FILES\u003c/code\u003e\u003c/td\u003e\n\u003ctd\u003e\u003cem\u003eExample value\u003c/em\u003e: \u003ccode\u003e./build\u003c/code\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n"},{id:5,href:"/docs/about/",title:"About",description:"",content:""},{id:6,href:"/docs/about/playground/",title:"Playground",description:"Quick Start with Playground",content:"\u003cp\u003eYou can try Dekart on \u003ca target=\"_blank\" href=\"https://play.dekart.xyz\"\u003eplay.dekart.xyz\u003c/a\u003e (requires Gmail Account) with one of many public datasets available on BigQuery.\u003c/p\u003e\n\u003cp\u003e\u003ca class=\"btn btn-primary\" target=\"_blank\" href=\"https://console.cloud.google.com/marketplace/browse?filter=solution-type:dataset\" role=\"button\"\u003eDiscover Public Data Sets\u003c/a\u003e\u003c/p\u003e\n\u003cp\u003e\u003ca target=\"_blank\" href=\"https://www.reddit.com/r/bigquery/wiki/datasets\" role=\"button\"\u003eEven more datasets\u003c/a\u003e\u003c/p\u003e\n\u003ch2 id=\"quick-start\"\u003eQuick Start\u003c/h2\u003e\n\u003cp align=\"center\"\u003e\u003cimg src=\"/images/screencast.gif\" width=\"100%\"/\u003e\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eGo to \u003ca target=\"_blank\" href=\"https://play.dekart.xyz\"\u003eplay.dekart.xyz\u003c/a\u003e\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eAuthorize with Gmail Account. Dekart Playground access only your email to store Maps you created on Playground. Emails are not used for any marketing purposes. You are not charge for anything.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eClick Create Report\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp align=\"center\"\u003e\u003cimg src=\"/images/quick-start-1.png\" width=\"100%\"/\u003e\u003c/p\u003e\n\u003col start=\"4\"\u003e\n\u003cli\u003eType example query (uses \u003ca href=\"https://console.cloud.google.com/marketplace/product/city-of-chicago-public-data/chicago-crime?project=dekart-playground\u0026amp;folder=\u0026amp;organizationId=\"\u003eChicago Crime Data\u003c/a\u003e)\u003c/li\u003e\n\u003c/ol\u003e\n\u003cdiv class=\"highlight\"\u003e\u003cpre class=\"chroma\"\u003e\u003ccode class=\"language-SQL\" data-lang=\"SQL\"\u003e\u003cspan class=\"k\"\u003eSELECT\u003c/span\u003e\n    \u003cspan class=\"n\"\u003eprimary_type\u003c/span\u003e\u003cspan class=\"p\"\u003e,\u003c/span\u003e\n    \u003cspan class=\"n\"\u003edistrict\u003c/span\u003e\u003cspan class=\"p\"\u003e,\u003c/span\u003e\n    \u003cspan class=\"n\"\u003elatitude\u003c/span\u003e\u003cspan class=\"p\"\u003e,\u003c/span\u003e\n    \u003cspan class=\"n\"\u003elongitude\u003c/span\u003e\u003cspan class=\"p\"\u003e,\u003c/span\u003e\n    \u003cspan class=\"nb\"\u003edate\u003c/span\u003e\n\u003cspan class=\"k\"\u003efrom\u003c/span\u003e \u003cspan class=\"o\"\u003e`\u003c/span\u003e\u003cspan class=\"n\"\u003ebigquery\u003c/span\u003e\u003cspan class=\"o\"\u003e-\u003c/span\u003e\u003cspan class=\"k\"\u003epublic\u003c/span\u003e\u003cspan class=\"o\"\u003e-\u003c/span\u003e\u003cspan class=\"k\"\u003edata\u003c/span\u003e\u003cspan class=\"p\"\u003e.\u003c/span\u003e\u003cspan class=\"n\"\u003echicago_crime\u003c/span\u003e\u003cspan class=\"p\"\u003e.\u003c/span\u003e\u003cspan class=\"n\"\u003ecrime\u003c/span\u003e\u003cspan class=\"o\"\u003e`\u003c/span\u003e\n\u003cspan class=\"k\"\u003eWHERE\u003c/span\u003e  \u003cspan class=\"n\"\u003eRand\u003c/span\u003e\u003cspan class=\"p\"\u003e()\u003c/span\u003e \u003cspan class=\"o\"\u003e\u0026lt;\u003c/span\u003e \u003cspan class=\"mi\"\u003e5\u003c/span\u003e \u003cspan class=\"o\"\u003e/\u003c/span\u003e \u003cspan class=\"mi\"\u003e100\u003c/span\u003e\u003cspan class=\"p\"\u003e.\u003c/span\u003e\u003cspan class=\"mi\"\u003e0\u003c/span\u003e\n\u003c/code\u003e\u003c/pre\u003e\u003c/div\u003e\u003col start=\"5\"\u003e\n\u003cli\u003eRun query (click Execute button)\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp align=\"center\"\u003e\u003cimg src=\"/images/quick-start-2.png\" width=\"100%\"/\u003e\u003c/p\u003e\n\u003col start=\"6\"\u003e\n\u003cli\u003eStyle a map (see \u003ca href=\"https://docs.kepler.gl/docs/user-guides\"\u003eKepler Docs\u003c/a\u003e for details)\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp align=\"center\"\u003e\u003cimg src=\"/images/quick-start-3.png\" width=\"100%\"/\u003e\u003c/p\u003e\n\u003col start=\"7\"\u003e\n\u003cli\u003eNow you can save and share you beautiful Map!\u003c/li\u003e\n\u003c/ol\u003e\n\u003cp\u003e\u003ca class=\"btn btn-primary\" target=\"_blank\" href=\"https://play.dekart.xyz/\" role=\"button\"\u003eGo to play.dekart.xyz\u003c/a\u003e\u003c/p\u003e\n"},{id:7,href:"/docs/about/screencast/",title:"Screencast",description:"Screencast: Querying Chicago Crime Dataset from BigQuery Public Data",content:"\u003cp align=\"center\"\u003e\u003cimg src=\"/images/screencast.gif\" width=\"100%\"/\u003e\u003c/p\u003e\n\u003cp align=\"center\"\u003e\u003ci\u003eQuerying Chicago Crime Dataset from BigQuery Public Data\u003c/i\u003e\u003c/p\u003e\n"},{id:8,href:"/docs/",title:"Documentation",description:"Docs Doks.",content:""},];index.add(docs);userinput.addEventListener('input',show_results,true);suggestions.addEventListener('click',accept_suggestion,true);function show_results(){var value=this.value;var results=index.search(value,5);var entry,childs=suggestions.childNodes;var i=0,len=results.length;suggestions.classList.remove('d-none');results.forEach(function(page){entry=document.createElement('div');entry.innerHTML='<a href><span></span><span></span></a>';a=entry.querySelector('a'),t=entry.querySelector('span:first-child'),d=entry.querySelector('span:nth-child(2)');a.href=page.href;t.textContent=page.title;d.textContent=page.description;suggestions.appendChild(entry);});while(childs.length>len){suggestions.removeChild(childs[i])}}
function accept_suggestion(){while(suggestions.lastChild){suggestions.removeChild(suggestions.lastChild);}
return false;}}());